import React from 'react';
import {Link} from 'react-scroll';
import styled from 'styled-components'

const SideNav = styled.div`
height:100vh;
position:fixed;
display:flex;
align-items:center;
margin-left:2em;
`

const NavList = styled.ul`
list-style:none;
padding:2em .5em;
margin:0;
display:flex;
flex-direction:column;
background-color:var(--p-3);
border-radius: 2.5em;
align-items:center;
`

const NavListItem = styled.li`
height:3em;
width:3em;
background-color:red;
margin:.5em 0;
`

export default function Sidebar () {
   return (
            <SideNav>
                <NavList>
                    <NavListItem>
                    <Link
                            activeClass="active"
                            to="about"
                            spy={true}
                            smooth={true}
                            offset={-70}
                            duration={500}
                        >
                            About
                        </Link>
                    </NavListItem>
                    <NavListItem>
                        <Link
                            activeClass="active"
                            to="recents"
                            spy={true}
                            smooth={true}
                            offset={-70}
                            duration={500}
                        >
                            Recents
                        </Link>
                    </NavListItem>
                </NavList> 
            </SideNav>
    )
}
